import React from "react";
import ImageCard from "./ImageList";
import Navbar from "./Navbar";
import SearchInput from "./SearchInput";
const ImageContainer = () => {
  return (
    <>
      <Navbar />
      <SearchInput />
      <ImageCard />
    </>
  );
};

export default ImageContainer;
